import React from "react";
import styles from "./AreaWeekMonth.module.sass";
import {connect} from 'react-redux';



 function AreaWeekMonth({chengeWeek, chengeMonth, isOpen}) {
  return (
    <>
    {isOpen && (
      <div className={styles.container}>
        <button onClick={chengeWeek} className={styles.button}>
          This week
        </button>
        <button onClick={chengeMonth} className={styles.button}>
          This month
        </button>
      </div>
    )}
  </>
  )
}

const mapStateToProps = (store) => ({
  isOpen: store.reducer
})

export default connect()(AreaWeekMonth);
